import React from "react";
import './Header_intro.css'
import {useNavigate} from 'react-router-dom';
import IntroImage from "../../assets/Intro_image.png";

function Header_intro(){
    /*const navigate = useNavigate();
    const handleStartClick = () => {
        navigate("/login");
    }*/

    return(
        <section className="Intro-section">
            <div className="Intro-image">
                <img src={IntroImage} alt="Intro"/>
            </div>
            <div className="Intro-content">
                <h3>오랫동안 일기 작성하게 만드는</h3>
                <h1><b>FeelsLike</b></h1>
                <h4>기록이 쉬워지는 순간, 당신의 하루가 특별해집니다.</h4>
                <br/>
                <p>
                    필즈라이크는 사용자가 자신의 감정을 진솔하게 표현하고,<br/>
                    기록의 가치를 지속적으로 경험할 수 있도록 돕는 것을 목표로 하고 있습니다.                   
                </p>
                <button className="start-btn" aria-label="Start journaling" /*onClick={handleStartClick}*/>시작하기</button>
            </div>
            <div className="wave-bottom">
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320">
                <path fill="#FDFCDC" d="M0,256L80,245.3C160,235,320,213,480,202.7C640,192,800,192,960,186.7C1120,181,1280,171,1360,165.3L1440,160L1440,320L1360,320C1280,320,1120,320,960,320C800,320,640,320,480,320C320,320,160,320,80,320L0,320Z"></path>
                </svg>
            </div>
        </section>
    );
}
export default Header_intro;
